(1388, '_transient_acf_pro_get_remote_info', 'a:16:{s:4:"name";s:26:"Advanced Custom Fields PRO";s:4:"slug";s:26:"advanced-custom-fields-pro";s:8:"homepage";s:37:"https://www.advancedcustomfields.com/";s:7:"version";s:6:"5.5.11";s:6:"author";s:13:"Elliot Condon";s:10:"author_url";s:28:"http://www.elliotcondon.com/";s:12:"contributors";s:12:"elliotcondon";s:8:"requires";s:5:"3.6.0";s:6:"tested";s:5:"4.8.0";s:4:"tags";a:57:{i:0;s:5:"5.5.9";i:1;s:5:"5.5.7";i:2;s:5:"5.5.5";i:3;s:5:"5.5.3";i:4;s:5:"5.5.2";i:5;s:6:"5.5.10";i:6;s:5:"5.5.1";i:7;s:5:"5.5.0";i:8;s:5:"5.4.8";i:9;s:5:"5.4.7";i:10;s:5:"5.4.6";i:11;s:5:"5.4.5";i:12;s:5:"5.4.4";i:13;s:5:"5.4.3";i:14;s:5:"5.4.2";i:15;s:5:"5.4.1";i:16;s:5:"5.4.0";i:17;s:5:"5.3.8";i:18;s:5:"5.3.7";i:19;s:5:"5.3.6";i:20;s:5:"5.3.5";i:21;s:5:"5.3.4";i:22;s:5:"5.3.3";i:23;s:5:"5.3.2";i:24;s:6:"5.3.10";i:25;s:5:"5.3.1";i:26;s:5:"5.3.0";i:27;s:5:"5.2.9";i:28;s:5:"5.2.8";i:29;s:5:"5.2.7";i:30;s:5:"5.2.6";i:31;s:5:"5.2.5";i:32;s:5:"5.2.4";i:33;s:5:"5.2.3";i:34;s:5:"5.2.2";i:35;s:5:"5.2.1";i:36;s:5:"5.2.0";i:37;s:5:"5.1.9";i:38;s:5:"5.1.8";i:39;s:5:"5.1.7";i:40;s:5:"5.1.6";i:41;s:5:"5.1.5";i:42;s:5:"5.1.4";i:43;s:5:"5.1.3";i:44;s:5:"5.1.2";i:45;s:5:"5.1.1";i:46;s:5:"5.1.0";i:47;s:5:"5.0.9";i:48;s:5:"5.0.8";i:49;s:5:"5.0.7";i:50;s:5:"5.0.6";i:51;s:5:"5.0.5";i:52;s:5:"5.0.4";i:53;s:5:"5.0.3";i:54;s:5:"5.0.2";i:55;s:5:"5.0.1";i:56;s:5:"5.0.0";}s:6:"tagged";s:123:"acf, advanced, custom, field, fields, custom field, custom fields, simple fields, magic fields, more fields, repeater, edit";s:11:"description";s:4337:"<p>Advanced Custom Fields is the perfect solution for any WordPress website which needs more flexible data like other Content Management Systems. </p>\n<ul><li>Visually create your Fields</li><li>Select from multiple input types (text, textarea, wysiwyg, image, file, page link, post object, relationship, select, checkbox, radio buttons, date picker, true / false, repeater, flexible content, gallery and more to come!)</li><li>Assign your fields to multiple edit pages (via custom location rules)</li><li>Easily load data through a simple and friendly API</li><li>Uses the native WordPress custom post type for ease of use and fast processing</li><li>Uses the native WordPress metadata for ease of use and fast processing</li></ul>\n<h4> Field Types </h4>\n<ul><li>Text (type text, api returns text)</li><li>Text Area (type text, api returns text)</li><li>Number (type number, api returns integer)</li><li>Email (type email, api returns text)</li><li>Password (type password, api returns text)</li><li>WYSIWYG (a WordPress wysiwyg editor, api returns html)</li><li>Image (upload an image, api returns the url)</li><li>File (upload a file, api returns the url)</li><li>Select (drop down list of choices, api returns chosen item)</li><li>Checkbox (tickbox list of choices, api returns array of choices)</li><li>Radio Buttons ( radio button list of choices, api returns chosen item)</li><li>True / False (tick box with message, api returns true or false)</li><li>Page Link (select 1 or more page, post or custom post types, api returns the selected url)</li><li>Post Object (select 1 or more page, post or custom post types, api returns the selected post objects)</li><li>Relationship (search, select and order post objects with a tidy interface, api returns the selected post objects)</li><li>Taxonomy (select taxonomy terms with options to load, display and save, api returns the selected term objects)</li><li>User (select 1 or more WP users, api returns the selected user objects)</li><li>Google Maps (interactive map, api returns lat,lng,address data)</li><li>Date Picker (jquery date picker, options for format, api returns string)</li><li>Color Picker (WP color swatch picker)</li><li>Tab (Group fields into tabs)</li><li>Message (Render custom messages into the fields)</li><li>Repeater (ability to create repeatable blocks of fields!)</li><li>Flexible Content (ability to create flexible blocks of fields!)</li><li>Gallery (Add, edit and order multiple images in 1 simple field)</li><li>[Custom](<a href="https://www.advancedcustomfields.com/resources/tutorials/creating-a-new-field-type/)">www.advancedcustomfields.com/resources/tutorials/creating-a-new-field-type/)</a> (Create your own field type!)</li></ul>\n<h4> Tested on </h4>\n<ul><li>Mac Firefox 	:)</li><li>Mac Safari 	:)</li><li>Mac Chrome	:)</li><li>PC Safari 	:)</li><li>PC Chrome		:)</li><li>PC Firefox	:)</li><li>iPhone Safari :)</li><li>iPad Safari 	:)</li><li>PC ie7		:S</li></ul>\n<h4> Website </h4>\n<p><a href="https://www.advancedcustomfields.com/">www.advancedcustomfields.com/</a></p>\n<h4> Documentation </h4>\n<ul><li>[Getting Started](<a href="https://www.advancedcustomfields.com/resources/#getting-started)">www.advancedcustomfields.com/resources/#getting-started)</a></li><li>[Field Types](<a href="https://www.advancedcustomfields.com/resources/#field-types)">www.advancedcustomfields.com/resources/#field-types)</a></li><li>[Functions](<a href="https://www.advancedcustomfields.com/resources/#functions)">www.advancedcustomfields.com/resources/#functions)</a></li><li>[Actions](<a href="https://www.advancedcustomfields.com/resources/#actions)">www.advancedcustomfields.com/resources/#actions)</a></li><li>[Filters](<a href="https://www.advancedcustomfields.com/resources/#filters)">www.advancedcustomfields.com/resources/#filters)</a></li><li>[How to guides](<a href="https://www.advancedcustomfields.com/resources/#how-to)">www.advancedcustomfields.com/resources/#how-to)</a></li><li>[Tutorials](<a href="https://www.advancedcustomfields.com/resources/#tutorials)">www.advancedcustomfields.com/resources/#tutorials)</a></li></ul>\n<h4> Bug Submission and Forum Support </h4>\n<p><a href="http://support.advancedcustomfields.com/">support.advancedcustomfields.com/</a></p>\n<h4> Please Vote and Enjoy </h4>\n<p>Your votes really make a difference! Thanks.</p>\n";s:12:"installation";s:467:"<ol><li>Upload <code>advanced-custom-fields</code> to the <code>/wp-content/plugins/</code> directory</li><li>Activate the plugin through the <code>Plugins</code> menu in WordPress</li><li>Click on the new menu item "Custom Fields" and create your first Custom Field Group!</li><li>Your custom field group will now appear on the page / post / template you specified in the field group''s location rules!</li><li>Read the documentation to display your data: </li></ol>\n";s:9:"changelog";s:4752:"<h4> 5.5.11 </h4>\n<ul><li>Google Map field: Added new <code>google_map_init</code> JS action</li><li>Core: Minor fixes and improvements</li><li>Language: Updated Swiss German translation - thanks to Raphael Huni</li><li>Language: Updated French translation - thanks to Maxime Bernard-Jacquet</li></ul>\n<h4> 5.5.10 </h4>\n<ul><li>API: Added new functionality to the `acf_form()` function:</li><li>- added new <code>html_updated_message</code> setting</li><li>- added new <code>html_submit_button</code> setting</li><li>- added new <code>html_submit_spinner</code> setting</li><li>- added new <code>acf/pre_submit_form</code> filter run when form is successfully submit (before saving $_POST)</li><li>- added new <code>acf/submit_form</code> action run when form is successfully submit (after saving $_POST)</li><li>- added new <code>%post_id%</code> replace string to the <code>return</code> setting</li><li>- added new encryption logic to prevent $_POST exploits</li><li>- added new `acf_register_form()` function</li><li>Core: Fixed bug preventing values being loaded on a new post/page preview</li><li>Core: Fixed missing <code>Bulk Actions</code> dropdown on sync screen when no field groups exist</li><li>Core: Fixed bug ignoring PHP field groups if exists in JSON</li><li>Core: Minor fixes and improvements</li></ul>\n<h4> 5.5.9 </h4>\n<ul><li>Core: Fixed bug causing ACF4 PHP field groups to be ignored if missing key setting</li></ul>\n<h4> 5.5.8 </h4>\n<ul><li>Flexible Content: Added logic to better <code>clean up</code> data when re-ordering layouts</li><li>oEmbed field: Fixed bug causing incorrect width and height settings in embed HTML</li><li>Core: Fixed bug causing incorrect Select2 CSS version loading for WooCommerce 2.7</li><li>Core: Fixed bug preventing <code>min-height</code> style being applied to floating width fields</li><li>Core: Added new JS <code>init</code> actions for wysiwyg, date, datetime, time and select2 fields</li><li>Core: Minor fixes and improvements</li></ul>\n<h4> 5.5.7 </h4>\n<ul><li>Core: Fixed bug causing `get_field()` to return incorrect data for sub fields registered via PHP code.</li></ul>\n<h4> 5.5.6 </h4>\n<ul><li>Core: Fixed bug causing license key to be ignored after changing url from http to https</li><li>Core: Fixed Select2 (v4) bug where <code>allow null</code> setting would not correctly save empty value</li><li>Core: Added new <code>acf/validate_field</code> filter</li><li>Core: Added new <code>acf/validate_field_group</code> filter</li><li>Core: Added new <code>acf/validate_post_id</code> filter</li><li>Core: Added new <code>row_index_offset</code> setting</li><li>Core: Fixed bug causing value loading issues for a taxonomy term in WP < 4.4</li><li>Core: Minor fixes and improvements</li></ul>\n<h4> 5.5.5 </h4>\n<ul><li>File field: Fixed bug creating draft post when saving an empty value</li><li>Image field: Fixed bug mentioned above</li></ul>\n<h4> 5.5.4 </h4>\n<ul><li>File field: Added logic to <code>connect</code> selected attachment to post (only if attachment is not <code>connected</code>)</li><li>File field: Removed `filesize()` call causing performance issues with externally hosted attachments</li><li>File field: Added AJAX validation to <code>basic</code> uploader</li><li>Image field: Added <code>connect</code> logic mentioned above</li><li>Image field: Added AJAX validation mentioned above</li><li>True false field: Improved usability by allowing <code>tab</code> key to focus element (use space or arrow keys to toggle)</li><li>Gallery field: Fixed bug causing unsaved changes in sidebar to be lost when selecting another attachment</li><li>API: Fixed `add_row()` and `add_sub_row()` return values (from true to new row index)</li><li>Core: Improved `get_posts()` query speeds by setting <code>update_cache</code> settings to false</li><li>Core: Allowed <code>instruction_placement</code> setting on <code>widget</code> forms (previously set always to <code>below fields</code>)</li><li>Core: Removed <code>ACF PRO invalid license nag</code> and will include fix for <code>protocol change</code> in next release</li><li>Language: Updated French translation - thanks to Martial Parfait</li></ul>\n<h4> 5.5.3 </h4>\n<ul><li>Options page: Fixed bug when using WPML in multiple tabs causing incorrect <code>lang</code> to be used during save.</li><li>Core: Added support with new `get_user_locale()` setting in WP 4.7</li><li>Core: Improved efficiency of termmeta DB upgrade logic</li><li>Core: Minor fixes and improvements</li></ul>\n<h4> 5.5.2 </h4>\n<ul><li>Tab field: Fixed bug causing value loading issues for field''s with the same name</li><li>Repeater field: Fixed bug in <code>collapsed</code> setting where field key was shown instead of field label</li></ul>\n";s:14:"upgrade_notice";s:551:"<h4> 5.2.7 </h4>\n<ul><li>Field class names have changed slightly in v5.2.7 from `field_type-{$type}` to `acf-field-{$type}`. This change was introduced to better optimise JS performance. The previous class names can be added back in with the following filter: <a href="https://www.advancedcustomfields.com/resources/acfcompatibility/">www.advancedcustomfields.com/resources/acfcompatibility/</a></li></ul>\n<h4> 3.0.0 </h4>\n<ul><li>Editor is broken in WordPress 3.3</li></ul>\n<h4> 2.1.4 </h4>\n<ul><li>Adds post_id column back into acf_values</li></ul>\n";s:7:"banners";a:2:{s:3:"low";s:65:"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.png";s:4:"high";s:66:"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.png";}}', 'no'),
