(1407, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/''>WordPress 4.7.3 Security and Maintenance Release</a> <span class="rss-date">March 6, 2017</span><div class="rssSummary">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by sixsecurity issues: Cross-site scripting (XSS) viamedia file metadata. Reported by Chris Andr Dale, Yorick Koster,and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://heropress.com/essays/journey-one-within/''>HeroPress: The Only Journey Is The One Within</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/open-collective-is-a-new-transparent-way-to-fund-open-source-projects''>WPTavern: Open Collective is a New, Transparent Way to Fund Open Source Projects</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/automattic-to-close-san-francisco-office''>WPTavern: Automattic to Close San Francisco Office</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> WooCommerce&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=woocommerce&amp;_wpnonce=7ad3e65e3d&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install WooCommerce">(Install)</a></li></ul></div>', 'no'),
