(5567, 415, '_form', '<div class="fn-name"><label> First name </label>\n [text* first-name class:fname]</div>\n<div class="ln-name"><label> Last name </label>\n [text* last-name class:lname]</div>\n<label> Email address  </label>\n[email* your-email class:email]\n<label> Company name  </label>\n[text your-company class:company]\n<label> Your job title </label>\n[text your-job class:job placeholder "i.e. Employee Wellness Director"]\n<label> City </label>\n[text your-city class:city]\n<label> Number of employees </label>\n[select your-employ class:employ "0 - 30" "31 - 100" "101 - 300" "301 - 600" "601 - 1,000" "1001 - 5,000" "5001+"]\n\n[submit class:submit_btn "Submit"]'),
(5568, 415, '_mail', 'a:9:{s:6:"active";b:1;s:7:"subject";s:19:"Fitspot new request";s:6:"sender";s:34:"Fitspot <corporate@fitspotapp.com>";s:9:"recipient";s:43:"corporate@fitspotapp.com, jawadarif@oso.nyc";s:4:"body";s:368:"From: [first-name] [last-name] <[your-email]>\nSubject: At-work Lead form submission\n\nMessage Body:\nFirst Name: [first-name]\nLast name: [last-name]\nEmail address: [your-email]\nCompany name: [your-company]\nYour job title: [your-job]\nCity: [your-city]\nNumber of employees: [your-employ] \n\n-- \nThis e-mail was sent from a contact form on Fitspot (http://localhost/fitspot)";s:18:"additional_headers";s:0:"";s:11:"attachments";s:0:"";s:8:"use_html";b:0;s:13:"exclude_blank";b:0;}'),
(5569, 415, '_mail_2', 'a:9:{s:6:"active";b:1;s:7:"subject";s:28:"Fitspot Request Consultation";s:6:"sender";s:34:"Fitspot <corporate@fitspotapp.com>";s:9:"recipient";s:12:"[your-email]";s:4:"body";s:121:"Hi [first-name] [last-name],\n\nThank-you for submitting for request of free consultation, we will get back to you shortly.";s:18:"additional_headers";s:34:"Reply-To: corporate@fitspotapp.com";s:11:"attachments";s:0:"";s:8:"use_html";b:0;s:13:"exclude_blank";b:0;}'),
(5570, 415, '_messages', 'a:23:{s:12:"mail_sent_ok";s:45:"Thank you for your message. It has been sent.";s:12:"mail_sent_ng";s:71:"There was an error trying to send your message. Please try again later.";s:16:"validation_error";s:61:"One or more fields have an error. Please check and try again.";s:4:"spam";s:71:"There was an error trying to send your message. Please try again later.";s:12:"accept_terms";s:69:"You must accept the terms and conditions before sending your message.";s:16:"invalid_required";s:22:"The field is required.";s:16:"invalid_too_long";s:22:"The field is too long.";s:17:"invalid_too_short";s:23:"The field is too short.";s:12:"invalid_date";s:29:"The date format is incorrect.";s:14:"date_too_early";s:44:"The date is before the earliest one allowed.";s:13:"date_too_late";s:41:"The date is after the latest one allowed.";s:13:"upload_failed";s:46:"There was an unknown error uploading the file.";s:24:"upload_file_type_invalid";s:49:"You are not allowed to upload files of this type.";s:21:"upload_file_too_large";s:20:"The file is too big.";s:23:"upload_failed_php_error";s:38:"There was an error uploading the file.";s:14:"invalid_number";s:29:"The number format is invalid.";s:16:"number_too_small";s:47:"The number is smaller than the minimum allowed.";s:16:"number_too_large";s:46:"The number is larger than the maximum allowed.";s:23:"quiz_answer_not_correct";s:36:"The answer to the quiz is incorrect.";s:17:"captcha_not_match";s:31:"Your entered code is incorrect.";s:13:"invalid_email";s:38:"The e-mail address entered is invalid.";s:11:"invalid_url";s:19:"The URL is invalid.";s:11:"invalid_tel";s:32:"The telephone number is invalid.";}'),
