(415, 1, '2017-04-03 12:06:56', '2017-04-03 12:06:56', '<div class="fn-name"><label> First name </label>\r\n [text* first-name class:fname]</div>\r\n<div class="ln-name"><label> Last name </label>\r\n [text* last-name class:lname]</div>\r\n<label> Email address  </label>\r\n[email* your-email class:email]\r\n<label> Company name  </label>\r\n[text your-company class:company]\r\n<label> Your job title </label>\r\n[text your-job class:job placeholder "i.e. Employee Wellness Director"]\r\n<label> City </label>\r\n[text your-city class:city]\r\n<label> Number of employees </label>\r\n[select your-employ class:employ "0 - 30" "31 - 100" "101 - 300" "301 - 600" "601 - 1,000" "1001 - 5,000" "5001+"]\r\n\r\n[submit class:submit_btn "Submit"]\n1\nFitspot new request\nFitspot <corporate@fitspotapp.com>\ncorporate@fitspotapp.com, jawadarif@oso.nyc\nFrom: [first-name] [last-name] <[your-email]>\r\nSubject: At-work Lead form submission\r\n\r\nMessage Body:\r\nFirst Name: [first-name]\r\nLast name: [last-name]\r\nEmail address: [your-email]\r\nCompany name: [your-company]\r\nYour job title: [your-job]\r\nCity: [your-city]\r\nNumber of employees: [your-employ] \r\n\r\n-- \r\nThis e-mail was sent from a contact form on Fitspot (http://localhost/fitspot)\n\n\n\n\n1\nFitspot Request Consultation\nFitspot <corporate@fitspotapp.com>\n[your-email]\nHi [first-name] [last-name],\r\n\r\nThank-you for submitting for request of free consultation, we will get back to you shortly.\nReply-To: corporate@fitspotapp.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2017-04-18 15:42:38', '2017-04-18 15:42:38', '', 0, 'http://localhost/fitspot/?post_type=wpcf7_contact_form&#038;p=415', 0, 'wpcf7_contact_form', '', 0),
