(811, 1, '2017-04-17 08:12:25', '2017-04-17 08:12:25', 'Stanford University, officially Leland Stanford Junior University, is a private research university in Stanford, California, adjacent to Palo Alto and between San Jose and San Francisco. Its 8,180-acre (12.8 sq mi; 33.1 km2) campus is one of the largest in the United States.note Stanford also has land and facilities elsewhere.\r\n\r\nThe university was founded in 1885 by Leland and Jane Stanford in memory of their only child, Leland Stanford Jr., who had died of typhoid fever at age 15 the previous year. Stanford was a former Governor of California and U.S. Senator; he made his fortune as a railroad tycoon. The school admitted its first students 126 years ago on October 1, 1891, as a coeducational and non-denominational institution.\r\n\r\n<img class="size-medium wp-image-810 alignleft" src="http://localhost/fitspot/wp-content/uploads/2017/04/our-story-image-2-300x197.jpg" alt="" width="300" height="197" />Stanford University struggled financially after Leland Stanford''s death in 1893 and again after much of the campus was damaged by the 1906 San Francisco earthquake. Following World War II, Provost Frederick Terman supported faculty and graduates financial struggles during that time period\r\n\r\nThere are three academic schools that have both undergraduate and graduate students and another four professional schools. Students compete in 36 varsity sports, and the university is one of two private institutions in the Division I FBS Pac-12 Conference. It has gained 111 NCAA team championships, the second-most for a university, 483 individual championships, the most in Division I, and has won the NACDA Directors'' Cup, recognizing the university with the best overall athletic team achievement, for 22 consecutive years, beginning in 19941995', 'Our Story', '', 'inherit', 'closed', 'closed', '', '428-revision-v1', '', '', '2017-04-17 08:12:25', '2017-04-17 08:12:25', '', 428, 'http://localhost/fitspot/2017/04/17/428-revision-v1/', 0, 'revision', '', 0),
(813, 1, '2017-04-17 08:13:28', '2017-04-17 08:13:28', 'Stanford University, officially Leland Stanford Junior University, is a private research university in Stanford, California, adjacent to Palo Alto and between San Jose and San Francisco. Its 8,180-acre (12.8 sq mi; 33.1 km2) campus is one of the largest in the United States.note Stanford also has land and facilities elsewhere.\n\nThe university was founded in 1885 by Leland and Jane Stanford in memory of their only child, Leland Stanford Jr., who had died of typhoid fever at age 15 the previous year. Stanford was a former Governor of California and U.S. Senator; he made his fortune as a railroad tycoon. The school admitted its first students 126 years ago on October 1, 1891, as a coeducational and non-denominational institution.\n\n<img class="alignnone size-medium wp-image-797" src="http://localhost/fitspot/wp-content/uploads/2017/04/our-story-image-1-300x197.jpg" alt="" width="300" height="197" />Stanford University struggled financially after Leland Stanford''s death in 1893 and again after much of the campus was damaged by the 1906 San Francisco earthquake. Following World War II, Provost Frederick Terman supported faculty and graduates financial struggles during that time period\n\nThere are three academic schools that have both undergraduate and graduate students and another four professional schools. Students compete in 36 varsity sports, and the university is one of two private institutions in the Division I FBS Pac-12 Conference. It has gained 111 NCAA team championships, the second-most for a university, 483 individual championships, the most in Division I, and has won the NACDA Directors'' Cup, recognizing the university with the best overall athletic team achievement, for 22 consecutive years, beginning in 19941995', 'Our Story', '', 'inherit', 'closed', 'closed', '', '428-autosave-v1', '', '', '2017-04-17 08:13:28', '2017-04-17 08:13:28', '', 428, 'http://localhost/fitspot/2017/04/17/428-autosave-v1/', 0, 'revision', '', 0),
(814, 1, '2017-04-17 08:13:35', '2017-04-17 08:13:35', 'Stanford University, officially Leland Stanford Junior University, is a private research university in Stanford, California, adjacent to Palo Alto and between San Jose and San Francisco. Its 8,180-acre (12.8 sq mi; 33.1 km2) campus is one of the largest in the United States.note Stanford also has land and facilities elsewhere.\r\n\r\nThe university was founded in 1885 by Leland and Jane Stanford in memory of their only child, Leland Stanford Jr., who had died of typhoid fever at age 15 the previous year. Stanford was a former Governor of California and U.S. Senator; he made his fortune as a railroad tycoon. The school admitted its first students 126 years ago on October 1, 1891, as a coeducational and non-denominational institution.\r\n\r\n<img class="alignleft wp-image-797" src="http://localhost/fitspot/wp-content/uploads/2017/04/our-story-image-1-300x197.jpg" alt="" width="374" height="246" />Stanford University struggled financially after Leland Stanford''s death in 1893 and again after much of the campus was damaged by the 1906 San Francisco earthquake. Following World War II, Provost Frederick Terman supported faculty and graduates financial struggles during that time period\r\n\r\nThere are three academic schools that have both undergraduate and graduate students and another four professional schools. Students compete in 36 varsity sports, and the university is one of two private institutions in the Division I FBS Pac-12 Conference. It has gained 111 NCAA team championships, the second-most for a university, 483 individual championships, the most in Division I, and has won the NACDA Directors'' Cup, recognizing the university with the best overall athletic team achievement, for 22 consecutive years, beginning in 19941995', 'Our Story', '', 'inherit', 'closed', 'closed', '', '428-revision-v1', '', '', '2017-04-17 08:13:35', '2017-04-17 08:13:35', '', 428, 'http://localhost/fitspot/2017/04/17/428-revision-v